import {action, observable, computed} from "mobx";


class TimeStore {
    @observable current_time = null;
    @action getTime = async () => {
        this.current_time = await new Date();
    }
    @computed get ms() {
        return new Date().getMilliseconds();
    }
}

export default TimeStore;
